if(!window.analytics){
    window.analytics = {Analytics1:{theType:"OFF"},Analytics2:{theType:"OFF"},Analytics3:{theType:"OFF"},Analytics4:{theType:"OFF"}}
}
window.setBound = function(name, theType){
    window.analytics[name] = {
        theType
    }
}
window.save = function(name){
    console.log("Saving settings")
    try{
        var topic = document.getElementById("topicInput" + name).value;
        var message_key = document.getElementById("sensorKeyInput" + name).value
        var bound = document.getElementById("boundInput" + name).value
        var params = JSON.stringify({bound:parseFloat(bound)})
        var theType = window.analytics[name].theType
        debugger;
        datasources['AnalyticsSaveConfiguration'].sendData({"type":theType, name, topic, message_key, params})
    }
    catch(e){
        console.log("Failed to save settings: " + JSON.stringify(e))
    }
}

